import React from 'react'
import styled from 'styled-components'

function Nav() {
    const Title = styled.h3`
      font-size: 20px;
      color: palevioletred;
      margin: 0;
      text-align: left;
    `;

    const Nav = styled.div`
      border-bottom: 1px solid white;
      display: flex;
      justify-content: space-between;
      padding: 10px 20px;
    `;

    const User = styled.p`
      font-size: 18px;
      color: palevioletred;
      margin: 0;
    `;
  return <Nav>
    <Title>Musicly</Title>
    <User>John Doe</User>
  </Nav>;
}

export default Nav
